    public JapaneseContextAnalysis() {
        this.reset();
    }

    public void handleData(byte[] buf, int offset, int length) {
        if (this.done) {
            return;
        }
        int maxPos = offset + length;
        int i = this.needToSkipCharNum + offset;
        while (i < maxPos) {
            this.getOrder(this.tmpOrder, buf, i);
            if ((i += this.tmpOrder.charLength) > maxPos) {
                this.needToSkipCharNum = i - maxPos;
                this.lastCharOrder = -1;
                continue;
            }
            if (this.tmpOrder.order == -1 || this.lastCharOrder == -1) continue;
            ++this.totalRel;
            if (this.totalRel > 1000) {
                this.done = true;
                break;
            }
            byte by = jp2CharContext[this.lastCharOrder][this.tmpOrder.order];
            this.relSample[by] = this.relSample[by] + 1;
        }
    }

    public void handleOneChar(byte[] buf, int offset, int charLength) {
        if (this.totalRel > 1000) {
            this.done = true;
        }
        if (this.done) {
            return;
        }
        int orderNum = -1;
        if (charLength == 2) {
            orderNum = this.getOrder(buf, offset);
        }
        if (orderNum != -1 && this.lastCharOrder != -1) {
            ++this.totalRel;
            byte by = jp2CharContext[this.lastCharOrder][orderNum];
            this.relSample[by] = this.relSample[by] + 1;
        }
        this.lastCharOrder = orderNum;
    }

    public float getConfidence() {
        if (this.totalRel > 4) {
            return (float)(this.totalRel - this.relSample[0]) / (float)this.totalRel;
        }
        return -1.0f;
    }

    public void reset() {
        this.totalRel = 0;
        for (int i = 0; i < 6; ++i) {
            this.relSample[i] = 0;
        }
        this.needToSkipCharNum = 0;
        this.lastCharOrder = -1;
        this.done = false;
    }

    public void setOption() {
    }

    public boolean gotEnoughData() {
        return this.totalRel > 100;
    }

    protected abstract void getOrder(Order var1, byte[] var2, int var3);

    protected abstract int getOrder(byte[] var1, int var2);

    protected static class Order {
        public int order = -1;
        public int charLength = 0;
    }
